import './App.css';
import Editor from "./components/Editor";
import Output from "./components/Output";
import React, { Component } from 'react';


class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      firstName: "First",
      lastName: "Last",
      userName: firstName + lastName,
      phone: "123"
    }
  }
  render(){
    return(
      <div className='App'>
        <Editor />
        <Output />
      </div>
    )
  }
}

export default App;
